import React from 'react';
import PageWrapper from './PageWrapper';

class DonePage extends React.Component{

  render(){
    return(
      <PageWrapper>
      <h2>Done</h2>
      <DownloadLink filename="results.txt" exportFile={() => this.props.logs}>Save</DownloadLink>
      </PageWrapper>
    )
  }
}

export default DonePage;
